// Action =  x
// Quotient ring basis (V) = 1,x,x^2,x*y,y,y^2,
// Available monomials (RR*V) = x^3,x^2*y,x*y^2,1,x,x^2,x*y,y,y^2,


void fast_eigenvector_solver(double * eigv, int neig, Eigen::Matrix<double,6,6> &AM, Matrix<std::complex<double>,2,6> &sols) {
	static const int ind[] = { 2,3,5 };	
	// Truncated action matrix containing non-trivial rows
	Matrix<double, 3, 6> AMs;
	double zi[3];
	
	for (int i = 0; i < 3; i++)	{
		AMs.row(i) = AM.row(ind[i]);
	}
	for (int i = 0; i < neig; i++) {
		zi[0] = eigv[i];
		for (int j = 1; j < 3; j++)
		{
			zi[j] = zi[j - 1] * eigv[i];
		}
		Matrix<double, 3,3> AA;
        AA.col(0) = AMs.col(5);
        AA.col(1) = zi[0] * AMs.col(3) + AMs.col(4);
        AA.col(2) = AMs.col(0) + zi[0] * AMs.col(1) + zi[1] * AMs.col(2);
        AA(2,0) = AA(2,0) - zi[0];
        AA(1,1) = AA(1,1) - zi[1];
        AA(0,2) = AA(0,2) - zi[2];


		Matrix<double, 2, 1>  s = AA.leftCols(2).colPivHouseholderQr().solve(-AA.col(2));
        sols(0,i) = zi[0];
        sols(1,i) = s(1);

	}
}



